import React from "react";
import { useNavigate } from "react-router-dom";

const Main:React.FC = ()=>{

    try{
       const res = fetch("http://localhost:1234/getData", {
            method:"POST",
            mode:"cors",
            headers: {
                'Content-Type': 'application/json',
            },
       })
    }catch(err){
        console.log("ERROR:",err)
    }

    return (
        <div id="center">hellworld</div>
    )
}

export default Main;
